void paintBGColor(short int c);
char waitForKey(int checkOnce, int numKeyCodes, const char keyCodes[numKeyCodes]);
void plot_pixel(int x, int y, short int line_color);
void clear_screen();
void vsyncWait();
void paintScreen(const short int screen[240][320]);
void paintImg(int x, int y, int e, int size_x, int size_y, const short int box_color[size_y][size_x]);

short int Buffer1[240][512]; // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];


// 2nd index: [0] is most recent value, [1] is one frame ago, [2] is two frames ago
int titleX[3]; // x & y of the upper left corner of the 2x2 box
int titleY = 76;

int dTitle = -3;
int finishRender = 0;

int numColors = 6;
short int colors[6] = {BLUE, GREEN, YELLOW, ORANGE, RED, PURPLE};
char colorKeys[6] = {KEYCODE_B, KEYCODE_G, KEYCODE_Y, KEYCODE_O, KEYCODE_R, KEYCODE_P};
int chosenColor = 0;

int timeAlloted = 10; // number of seconds we allow for an answer
int progressBarWidth = 0;
int progressBarY = 220;

// 0 - initial screen (before & after animation), 
int screen = 0; 

int main(void) {

	titleX[0] = titleX[1] = titleX[2] = 93;
	int titleNumCols = sizeof(title[0]) / sizeof(title[0][0]);
	int titleNumRows = sizeof(title) / sizeof(title[0]);
	int move = 1;
    volatile int * pixel_ctrl_ptr = (int *) PIXEL_CTRL_BASE;

    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; 
    vsyncWait();
    pixel_buffer_start = *pixel_ctrl_ptr;
	paintScreen(start_screen);
	paintImg(titleX[0], titleY, 0, titleNumCols, titleNumRows, title);

    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	paintScreen(start_screen);
	paintImg(titleX[0], titleY, 0, titleNumCols, titleNumRows, title);

	
	const char keys[1] = {KEYCODE_ENTER};
	waitForKey(0, 1, keys);

    while (1) {
		if (screen == 0) {
			if (move) {
				if (titleX[0] <= 10) { 
					move = 0;				
				} else {
					titleX[2] = titleX[1];
					titleX[1] = titleX[0];
					titleX[0] += dTitle;

					//paintScreen(start_screen);
					
					paintImg(titleX[2], titleY, 1, titleNumCols, titleNumRows, title);
					paintImg(titleX[0], titleY, 0, titleNumCols, titleNumRows, title);
				}
			}
			if (!move) {
				if (finishRender != 2) { // necessary to draw over front and back buffer
					paintImg(160, 50, 0, 120, 50, StartButton);
					paintImg(160, 110, 0, 120, 50, InstructionButton);
					paintImg(90, 190, 1, 229, 49, InstructionButton);
					paintImg(110, 185, 0, 150, 51, cowboi);
					finishRender++;
				} else {
					const char keys[1] = {KEYCODE_S};
					waitForKey(0, 1, keys);
					screen = 1;
					finishRender = 0;
				}
			}
		} else if (screen = 1) {
			if (finishRender == 0) {
				chosenColor = rand() % numColors;
				paintBGColor(colors[chosenColor]);
				finishRender++;
			} else if (finishRender == 1) {
				paintBGColor(colors[chosenColor]);
				finishRender++;
			} else if (finishRender == 2) {
				const char keys[1] = {colorKeys[chosenColor]};
				finishRender = 0;
				waitForKey(0, 1, keys);

			}
		}

       	vsyncWait(); // swap front and back buffers on VGA vertical sync
    	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}

char waitForKey(int checkOnce, int numKeyCodes, const char keyCodes[numKeyCodes]) {
	// poll for the "make" signal of a given key, and return when we get it
	volatile int *PS2_ptr = (int*) PS2_BASE;

	if (checkOnce) {
		int PS2_data, RVALID;
		char inByte;
		PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
		RVALID = PS2_data & 0x8000; // extract the RVALID field 
		if (RVALID) {
			inByte = PS2_data & 0xFF;
			for (int i = 0; i < numKeyCodes; ++i) {
				if (inByte == keyCodes[i]) {
					return keyCodes[i];
				}
			}
		}
		return KEYCODE_NO_KEY;
	} else {
		int PS2_data, RVALID;
		char inByte;
		while (1) {
			PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
			RVALID = PS2_data & 0x8000; // extract the RVALID field 
			if (RVALID) {
				inByte = PS2_data & 0xFF;
				for (int i = 0; i < numKeyCodes; ++i) {
					if (inByte == keyCodes[i]) {
						return keyCodes[i];
					}
				}
			}
		}
	}
}

// code for subroutines (not shown)
void paintImg(int x, int y, int e, int size_x, int size_y, const short int box_color[size_y][size_x]){
	if(e){
		for(int k = 0; k<size_y; k++){
			for(int j = 0; j<size_x; j++){
				plot_pixel(x+j, y+k, 65535);
			}
		}
	}else{
		for(int k = 0; k<size_y; k++){
			for(int j = 0; j<size_x; j++){
				plot_pixel(x+j, y+k, box_color[k][j]);
			}
		}
	}
}

void vsyncWait() {
    volatile int * pixel_ctrl_ptr = (int *) PIXEL_CTRL_BASE;
    *pixel_ctrl_ptr = 1;
    int status = *(pixel_ctrl_ptr + 3) & 1;
    while (status != 0) {
        status = *(pixel_ctrl_ptr + 3) & 1;
    }
}

void paintBGColor(short int c) {
	for (int x = 0; x < 320; ++x) {
        for (int y = 0; y < 240; ++y) {
            plot_pixel(x, y, c);
        }
    }
}

void paintScreen(const short int screen[240][320]) {
    for (int x = 0; x < 320; ++x) {
        for (int y = 0; y < 240; ++y) {
            plot_pixel(x, y, screen[y][x]);
        }
    }
}

void clear_screen() {
    for (int x = 0; x < 320; ++x) {
        for (int y = 0; y < 240; ++y) {
            plot_pixel(x, y, 0);
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = line_color;
}